    "parents.introDescription":
      "Scratch-ი წარმოადგენს პროგრამულ ენასა და ონლაინ-საზოგადოებას, სადაც ბავშვებს შეუძლიათ დააპროგრამონ და გაუზიარონ მთელი სამყაროს ადამიანებს  ისეთი ინტერაქტიული მედია, როგორიცაა ამბები, თამაშები  და მულტფილმები.  Scratch-ის მეშვეობით ბავშვები სწავლობენ შემოქმედებით აზროვნებას, გუნდურ მუშაობას და სისტემურად მსჯელობას. Scratch-ი შექმნილია MIT Media ლაბორატორიის Lifelong Kindergarten ჯგუფის მიერ, რომელიც უზრუნველყოფს მის მუშაობას.",
